  false,\n\t\"url\": null,\n\t\"notes\": \"This document presents biological considerations
  of land use planning for the United States Department of Agriculture Beltsville
  Agricultural Research Center and for three adjacent federal facilities, in order
  to support informed policy decisions about land management in accordance with the
